import React, {Component, useState} from 'react';

export class IndividualTeam extends React.Component {
    render() {
        return (
            <div className="col-lg-3 centered">
                <img src={this.props.pfp} alt={this.props.prpAlt}/>
                <br/>
                <br/>
                <p>
                    <b>{this.props.name}</b>
                </p>
                <p>{this.props.role}</p>
            </div>
        )
    }
}
